import React, { useState } from 'react';

// Movie data with 10 movies
const movies = [
  {
    name: "The Dark Knight",
    imdbRating: 9.0,
    trailerUrl: "https://www.youtube.com/embed/EXeTwQWrcwY",
    description: "A superhero film directed by Christopher Nolan.",
    characters: ["Bruce Wayne", "Joker", "Rachel Dawes"],
    image: "https://m.media-amazon.com/images/I/81cHfEZ7-hL._AC_SY679_.jpg"
  },
  {
    name: "Inception",
    imdbRating: 8.8,
    trailerUrl: "https://www.youtube.com/embed/YoHD9XEInc0",
    description: "A mind-bending thriller by Christopher Nolan.",
    characters: ["Dom Cobb", "Robert Fischer", "Mal"],
    image: "https://m.media-amazon.com/images/I/71p5-Sv2+LL._SY679_.jpg"
  },
  {
    name: "The Matrix",
    imdbRating: 8.7,
    trailerUrl: "https://www.youtube.com/embed/vKQi3bBA1y8",
    description: "A hacker discovers a dystopian world controlled by machines.",
    characters: ["Neo", "Trinity", "Morpheus"],
    image: "https://m.media-amazon.com/images/I/51kNf6hxG6L._SY679_.jpg"
  },
  {
    name: "The Godfather",
    imdbRating: 9.2,
    trailerUrl: "https://www.youtube.com/embed/sY1S34973zA",
    description: "The aging patriarch of an organized crime dynasty transfers control to his son.",
    characters: ["Vito Corleone", "Michael Corleone", "Sonny Corleone"],
    image: "https://m.media-amazon.com/images/I/41yDT8q6XXL._SY679_.jpg"
  },
  {
    name: "The Shawshank Redemption",
    imdbRating: 9.3,
    trailerUrl: "https://www.youtube.com/embed/6hB3S9bIaco",
    description: "Two imprisoned men form a bond over several years.",
    characters: ["Andy Dufresne", "Ellis Boyd Redding"],
    image: "https://m.media-amazon.com/images/I/71NggZ5xwvL._AC_SY679_.jpg"
  },
  {
    name: "Pulp Fiction",
    imdbRating: 8.9,
    trailerUrl: "https://www.youtube.com/embed/s7EdQ4FqbhY",
    description: "The lives of two mob hitmen, a boxer, a gangster's wife, and a pair of diner bandits intertwine.",
    characters: ["Vincent Vega", "Jules Winnfield", "Mia Wallace"],
    image: "https://m.media-amazon.com/images/I/91kZ79D2eAL._AC_SY679_.jpg"
  },
  {
    name: "Forrest Gump",
    imdbRating: 8.8,
    trailerUrl: "https://www.youtube.com/embed/bLvqoHBptjg",
    description: "The presidencies of Kennedy and Johnson, the Vietnam War, and other historical events unfold from the perspective of Forrest Gump.",
    characters: ["Forrest Gump", "Jenny Curran"],
    image: "https://m.media-amazon.com/images/I/91Z3yCCzpLL._AC_SY679_.jpg"
  },
  {
    name: "The Lord of the Rings: The Return of the King",
    imdbRating: 8.9,
    trailerUrl: "https://www.youtube.com/embed/r5X-hFf6Bwo",
    description: "Gondor's forces mount a siege in the battle for Middle-earth.",
    characters: ["Frodo Baggins", "Samwise Gamgee", "Gollum"],
    image: "https://m.media-amazon.com/images/I/61fKKYmL7WL._SY679_.jpg"
  },
  {
    name: "The Lion King",
    imdbRating: 8.5,
    trailerUrl: "https://www.youtube.com/embed/4sj1fG1g8I0",
    description: "Lion prince Simba and his father are targeted by his bitter uncle, who wants to ascend the throne himself.",
    characters: ["Simba", "Mufasa", "Scar"],
    image: "https://m.media-amazon.com/images/I/71mfSyWSFtL._SY679_.jpg"
  },
  {
    name: "Gladiator",
    imdbRating: 8.5,
    trailerUrl: "https://www.youtube.com/embed/olP_Go1xOpw",
    description: "A former Roman General sets out to exact vengeance against the corrupt emperor who murdered his family.",
    characters: ["Maximus", "Commodus", "Lucilla"],
    image: "https://m.media-amazon.com/images/I/71p-gy9qFqL._AC_SY679_.jpg"
  }
  // Add more movies here...
];

const Dashboard = () => {
  const [selectedMovie, setSelectedMovie] = useState(null);

  const handleMovieClick = (movie) => {
    setSelectedMovie(movie);
  };

  const closeModal = () => {
    setSelectedMovie(null);
  };

  return (
    <div className="dashboard">
      <h2>Movies Dashboard</h2>
      <div className="movie-list">
        {movies.map((movie, index) => (
          <div
            key={index}
            className="movie-item"
            onClick={() => handleMovieClick(movie)}
          >
            <img src={movie.image} alt={movie.name} />
            <h3>{movie.name}</h3>
            <div className="rating">
              IMDb: {movie.imdbRating}
            </div>
          </div>
        ))}
      </div>

      {selectedMovie && (
        <div className="movie-modal">
          <div className="modal-content">
            <button onClick={closeModal} className="close-btn">Close</button>
            <h2>{selectedMovie.name}</h2>
            <iframe
              src={selectedMovie.trailerUrl}
              title="Movie Trailer"
              width="100%"
              height="400px"
              allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
              allowFullScreen
            />
            <p><strong>Description:</strong> {selectedMovie.description}</p>
            <p><strong>Characters:</strong> {selectedMovie.characters.join(", ")}</p>
          </div>
        </div>
      )}
    </div>
  );
};

export default Dashboard;
